DROP TABLE IF EXISTS `web_role`;
CREATE TABLE `web_role`
(
    `rid`       int(11) NOT NULL AUTO_INCREMENT,
    `rname`     varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL,
    `rdesc`     varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL,
    `rval`      varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL,
    `created`   datetime(0) NULL DEFAULT CURRENT_TIMESTAMP,
    `updated`   datetime(0) NULL DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP (0),
    `deletable` int(11) NOT NULL DEFAULT 1,
    `rtype`     char(1) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci      NOT NULL COMMENT '1-监管,2-机构,3-个人,4-协会',
    PRIMARY KEY (`rid`) USING BTREE,
    UNIQUE INDEX `udx_rval` (`rval`) USING BTREE,
    UNIQUE INDEX `udx_rname` (`rname`) USING BTREE
) ENGINE = InnoDB
  AUTO_INCREMENT = 165
  CHARACTER SET = utf8mb4
  COLLATE = utf8mb4_general_ci;

