-- ----------------------------
-- Table structure for web_sys_file
-- ----------------------------
DROP TABLE IF EXISTS `web_sys_file`;
CREATE TABLE `web_sys_file`
(
    `id`               bigint(20) NOT NULL COMMENT '主键id',
    `bucket`           varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '文件桶,即所在目录',
    `file_origin_name` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '文件名称（上传时候的文件名）',
    `file_suffix`      varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '文件后缀',
    `file_size_kb`     bigint(20) NULL DEFAULT NULL COMMENT '文件大小kb',
    `file_size_info`   varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '文件大小信息，计算后的',
    `file_object_name` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '存储到服务器上的名称（文件唯一标识id）',
    `file_path`        varchar(1000) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '存储路径',
    `create_time`      datetime(0) NULL DEFAULT NULL COMMENT '创建时间',
    `create_user`      varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '创建用户',
    PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB
  CHARACTER SET = utf8
  COLLATE = utf8_general_ci COMMENT = '文件信息表';

