-- ----------------------------
-- Table structure for web_user
-- ----------------------------
DROP TABLE IF EXISTS `web_user`;
CREATE TABLE `web_user`
(
    `uid`          int(11) NOT NULL AUTO_INCREMENT,
    `org_id`       varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci  NOT NULL DEFAULT '0000000000' COMMENT '机构号(只针对内部用户)',
    `uname`        varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '用户名',
    `nick`         varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '昵称',
    `contact_name` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '企业/机构联系人姓名',
    `work_no`      varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '工号(只针对内部用户)',
    `dept_id`      varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '部门(只针对内部用户)',
    `position`     varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '职位(只针对内部用户)',
    `pwd`          varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '密码',
    `salt`         varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '盐',
    `mobile`       varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '手机号',
    `telephone`    varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '固定电话',
    `email`        varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT 'email',
    `id_no`        varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '证件号码',
    `id_type`      varchar(10) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '证件类型,01-身份证号,02-纳税人识别号',
    `address`      varchar(1000) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '地址',
    `type`         varchar(1) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci   NOT NULL COMMENT '1-监管,2-机构,3-个人,4-协会',
    `created`      datetime(0) NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建日期',
    `updated`      datetime(0) NULL DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP (0) COMMENT '最后修改日期',
    `pwd_updated`  datetime(0) NULL DEFAULT NULL COMMENT '最后修改密码时间',
    `del_flag`     varchar(1) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci   NOT NULL DEFAULT '0' COMMENT '1-删除,0-未删除',
    PRIMARY KEY (`uid`) USING BTREE,
    UNIQUE INDEX `idx_uname` (`uname`) USING BTREE,
    INDEX          `idx_org_id` (`org_id`) USING BTREE
) ENGINE = InnoDB
  AUTO_INCREMENT = 253
  CHARACTER SET = utf8mb4
  COLLATE = utf8mb4_general_ci;

